import URL from 'url'

import { SourceMapSupport } from './index.js'

SourceMapSupport.install({ 
  'handleUncaughtExceptions': false, 
  'retrieveSourceMap': function(source) {

    if (/^file:/.test(source)) {
      return SourceMapSupport.retrieveSourceMap(URL.fileURLToPath(source))
    } else {
      return null
    }

  }
})

import Sinon from 'sinon'
import Test from 'ava'

import { NextWorkerPool } from '../../../index.js'

const Require = __require

Test('NextWorkerPool._selectProcess(methodName, parameter)', async (test) => {

  const sandbox = Sinon.createSandbox()

  try {

    let pool = new NextWorkerPool(Require.resolve('../worker.js'))

    try {

      sandbox.spy(pool, '_selectProcess')

      await pool.module.getPid()

      test.true(pool._selectProcess.calledOnce)
      test.true(pool._selectProcess.calledWith('getPid', []))

    } finally {
      await pool.exit()
    }

  } finally {
    sandbox.restore()
  }

})

import ChangeCase from 'change-case'
import { Configuration } from '@virtualpatterns/mablung-configuration'

import { ForkedProcess } from './forked-process.js'
import { WorkerClientModuleHandler } from './worker-client-module-handler.js'
import { WorkerClientParameter } from './worker-client-parameter.js'

import { WorkerClientDurationExceededError } from './error/worker-client-duration-exceeded-error.js'
import { WorkerClientRejectedError } from './error/worker-client-rejected-error.js'
import { WorkerClientDisconnectedError } from './error/worker-client-disconnected-error.js'
import { WorkerClientInternalError } from './error/worker-client-internal-error.js'
import { WorkerClientExitedError } from './error/worker-client-exited-error.js'
import { WorkerClientKilledError } from './error/worker-client-killed-error.js'

const { pascalCase: PascalCase } = ChangeCase
// const Require = __require

class WorkerClient extends ForkedProcess {

  constructor(...parameter) {
    super(...WorkerClientParameter.getConstructorParameter(...parameter))

    this._isReady = false

    this._module = new Proxy(this, WorkerClientModuleHandler)

  }

  // get _defaultParameter() {
  //   return Configuration.merge(super._defaultParameter, { '--worker-server-class-path': Require.resolve('./worker-server.js') })
  // }

  get _defaultOption() {
    return Configuration.merge(super._defaultOption, { 'maximumDuration': 10000 })
  }

  _onMessage(message) {

    let methodName = `_on${PascalCase(message.type)}`
    this[methodName](message)

    super._onMessage(message)

  }

  _onReady(message) {
    this.emit('ready', message)
  }

  _onPing(message) {
    this.emit('ping', message)
  }

  _onApply(message) {
    this.emit('apply', message)
  }

  _onError(error) {
    this._onReject(new WorkerClientInternalError(error))
    super._onError(error)
  }

  _onDisconnect() {
    this._onReject(new WorkerClientDisconnectedError())
    super._onDisconnect()
  }

  _onExit(code) {
    this._onReject(new WorkerClientExitedError(code))
    super._onExit(code)
  }

  _onKill(signal) {
    this._onReject(new WorkerClientKilledError(signal))
    super._onKill(signal)
  }

  _onReject(error) {
    this.emit('reject', error)
  }

  get maximumDuration() {
    return this.option.maximumDuration
  }

  set maximumDuration(value) {
    this.option.maximumDuration = value
  }

  get module() {
    return this._module
  }

  async whenReady() {

    if (!this._isReady) {
      await this.whenMessageType('ready')
      this._isReady = true
    }

  }

  whenMessageType(type) {
    // this.console.log(`WorkerClient.whenMessageType('${type}') { ... }`)

    return new Promise((resolve, reject) => {

      let onMessage = null
      let onReject = null
      let timeout = null

      this.on('message', onMessage = (message) => {
        // this.console.log('WorkerClient.on(\'message\', onMessage = (message) => { ... })')
        // this.console.dir(message)

        if (message.type === type) {

          this.off('message', onMessage)
          onMessage = null

          this.off('reject', onReject)
          onReject = null

          if (this.maximumDuration > 0) {
            clearTimeout(timeout)
            timeout = null
          }

          resolve(message)

        }

      })

      this.on('reject', onReject = (error) => {
        // this.console.error('WorkerClient.on(\'reject\', onReject = (error) => { ... })')
        // this.console.error(error)

        this.off('message', onMessage)
        onMessage = null

        this.off('reject', onReject)
        onReject = null

        if (this.maximumDuration > 0) {
          clearTimeout(timeout)
          timeout = null
        }

        reject(error)

      })

      if (this.maximumDuration > 0) {

        timeout = setTimeout(() => {

          this.off('message', onMessage)
          onMessage = null

          this.off('reject', onReject)
          onReject = null

          clearTimeout(timeout)
          timeout = null

          reject(new WorkerClientDurationExceededError(this.maximumDuration))

        }, this.maximumDuration)

      }

    })

  }

  whenRejected(errorClass = WorkerClientRejectedError) {
    // this.console.log(`WorkerClient.whenRejected(${errorClass.name}) { ... }`)

    return new Promise((resolve, reject) => {

      let onReject = null
      let timeout = null

      this.on('reject', onReject = (error) => {
        // this.console.error('WorkerClient.on(\'reject\', onReject = (error) => { ... })')
        // this.console.error(error)

        if (error instanceof errorClass) {

          this.off('reject', onReject)
          onReject = null

          if (this.maximumDuration > 0) {
            clearTimeout(timeout)
            timeout = null
          }

          resolve(error)

        }

      })

      if (this.maximumDuration > 0) {

        timeout = setTimeout(() => {

          this.off('reject', onReject)
          onReject = null

          clearTimeout(timeout)
          timeout = null

          reject(new WorkerClientDurationExceededError(this.maximumDuration))

        }, this.maximumDuration)

      }

    })

  }

  async send(requestMessage) {

    let responsePromise = this.whenMessageType(requestMessage.type)
    let sendPromise = super.send(requestMessage)

    let [, responseMessage] = await Promise.all([ sendPromise, responsePromise ])

    if (responseMessage.error) {
      throw responseMessage.error
    }

    return responseMessage.returnValue

  }

  async ping() {
    await this.whenReady()
    return this.send({ 'type': 'ping' })
  }

  async apply(methodName, parameter) {
    await this.whenReady()
    return this.send({ 'type': 'apply', 'methodName': methodName, 'parameter': parameter })
  }

  disconnect() {
    super.disconnect()
    return this.whenRejected(WorkerClientDisconnectedError)
  }

  async exit(code = 0) {
    await this.whenReady()
    await super.send({ 'type': 'exit', 'code': code }) // there will be no response
    await this.whenRejected(WorkerClientExitedError)
  }

  kill(...parameter) {
    super.kill(...parameter)
    return this.whenRejected(WorkerClientKilledError)
  }

}

export { WorkerClient }

import { Configuration } from '@virtualpatterns/mablung-configuration'
import { Is } from '@virtualpatterns/mablung-is'

import { ChildProcessPool } from './child-process-pool.js'
import { WorkerClient } from './worker-client.js'
import { WorkerPoolModuleHandler } from './worker-pool-module-handler.js'
import { WorkerPoolParameter } from './worker-pool-parameter.js'

import { WorkerPoolDisconnectedError } from './error/worker-pool-disconnected-error.js'

const Process = process

class WorkerPool extends ChildProcessPool {

  constructor(...parameter) {
    super(...WorkerPoolParameter.getConstructorParameter(...parameter))

    this._module = new Proxy(this, WorkerPoolModuleHandler)

  }

  _createProcess(index, path, parameter, option) {
    return new WorkerClient(path, parameter, Configuration.merge(option, { 'env': Configuration.merge(Process.env, { 'WORKER_POOL_INDEX': index }) }))
  }

  async _selectProcess(/* methodName, parameter */) {
    let { index } = await this.ping()
    return this._getProcess(index)
  }

  get maximumDuration() {
    return this.option.maximumDuration
  }

  set maximumDuration(value) {
    this.option.maximumDuration = value
    this._getConnectedProcess().forEach((workerClient) => workerClient.maximumDuration = value)
  }

  get module() {
    return this._module
  }

  async ping() {

    let process = this._getConnectedProcess()

    if (process.length > 0) {

      let pingResult = null
      pingResult = await Promise.all(process.map((workerClient) => workerClient.ping()))
      pingResult = pingResult.reduce((minimumResult, result) => Is.null(minimumResult) || result.cpuUsage < minimumResult.cpuUsage ? result : minimumResult, null)

      return pingResult

    } else {
      throw new WorkerPoolDisconnectedError()
    }

  }

  async apply(methodName, parameter) {
    return (await this._selectProcess(methodName, parameter)).apply(methodName, parameter)
  }

  async disconnect() {

    let process = this._getConnectedProcess()

    if (process.length > 0) {
      return Promise.all(process.map((workerClient) => workerClient.disconnect()))
    } else {
      throw new WorkerPoolDisconnectedError()
    }

  }

  async exit(code = 0) {

    let process = this._getConnectedProcess()

    if (process.length > 0) {
      return Promise.all(process.map((workerClient) => workerClient.exit(code)))
    } else {
      throw new WorkerPoolDisconnectedError()
    }

  }

  async kill(...parameter) {

    let process = this._getConnectedProcess()

    if (process.length > 0) {
      return Promise.all(process.map((workerClient) => workerClient.kill(...parameter)))
    } else {
      throw new WorkerPoolDisconnectedError()
    }

  }

}

export { WorkerPool }

import { Is } from '@virtualpatterns/mablung-is'

import { WorkerPool } from '../worker-pool.js'

class NextWorkerPool extends WorkerPool {

  constructor(...parameter) {
    super(...parameter)

    this._nextIndex = 0

  }

  _selectProcess() {

    let process = null

    while (Is.null(process) || !process.isConnected) {
      process = this._getProcess(this._nextIndex++ % this.numberOfProcess)
    }

    return process

  }

}

export { NextWorkerPool }

import { Is } from '@virtualpatterns/mablung-is'

import { WorkerPool } from '../worker-pool.js'

class RandomWorkerPool extends WorkerPool {

  constructor(...parameter) {
    super(...parameter)
  }

  async _selectProcess() {

    let process = null

    while (Is.null(process) || !process.isConnected) {
      process = this._getProcess(Math.round(Math.random() * (this.numberOfProcess - 1)))
    }

    return process

  }

}

export { RandomWorkerPool }

