import _ChildProcess from 'child_process'

import { ChildProcess } from './child-process.js'

class ForkedProcess extends ChildProcess {

  constructor(path, parameter = {}, option = {}) {
    super(path, parameter, option)
  }

  _createProcess(path, parameter, option) {
    return _ChildProcess.fork(path, parameter, option)
  }

}

export { ForkedProcess }

const EXCLUDE_PROPERTY_NAME = [ 'then' ]

class WorkerClientModuleHandler {

  static get(target, propertyName) {

    if (!EXCLUDE_PROPERTY_NAME.includes(propertyName)) {
      return (function (...parameter) { return target.apply(propertyName, parameter) }).bind(target)
    } else {
      return undefined
    }

  }

}

export { WorkerClientModuleHandler }

import { Is } from '@virtualpatterns/mablung-is'

const Require = __require

class WorkerClientParameter {

  static getConstructorParameter(...parameter) {

    // the defaults
    let _path = Require.resolve('./create-worker-server.js')
    let _parameter = {}
    let _option = {}

    switch (parameter.length) {
      case 0:
        // _path = default
        // _parameter = default
        // _option = default
        break
      case 1:

        switch (true) {
          case Is.string(parameter[0]):
            // _path = default
            _parameter = { '--import-path': parameter[0] }
            // _option = default
            break
          default:
            // _path = default
            // _parameter = default
            _option = parameter[0]
        }

        break
      case 2:

        switch (true) {
          case Is.string(parameter[0]):
            // _path = default
            _parameter = { '--import-path': parameter[0] }
            _option = parameter[1]
            break
          default:
            // _path = default
            _parameter = parameter[0]
            _option = parameter[1]
        }

        break
      default:
        _path = parameter[0]
        _parameter = parameter[1]
        _option = parameter[2]
    }

    return [ _path, _parameter, _option ]

  }

}

export { WorkerClientParameter }

import { WorkerClientError } from './worker-client-error.js'

class WorkerClientRejectedError extends WorkerClientError {

